import React from "react";
import {
  Button,
  CardContent,
  Grid,
  Table,
  TextField,
  Card,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import BorderColorIcon from "@mui/icons-material/BorderColor";
import DeleteIcon from "@mui/icons-material/Delete";

export const Categorylist = ({ name, setName }) => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate("/cat");
  };

  return (
    <Card sx={{ background: "lightblue" }}>
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={2}>
            <h3>Category List</h3>
          </Grid>
          <Grid item xs={8}></Grid>
          <Grid item xs={2}>
            <Button
              onClick={handleBack}
              variant="contained"
              fullWidth
              color="success"
            >
              Add Category{" "}
            </Button>
          </Grid>
          <Grid item xs={12}>
            <Grid container spacing={2}>
              <Grid item xs={7}></Grid>
              <Grid item xs={1}>
                <p>Search:</p>
              </Grid>
              <Grid item xs={3}>
                <TextField variant="outlined" fullWidth />
              </Grid>
            </Grid>
          </Grid>
          <Grid item xs={12}>
            <Table>
              <tr>
                <th>SL</th>
                <th>Category Name</th>
                <th>Status</th>
                <th>Action</th>
              </tr>

              <tr>
                <td>1</td>
                {name.map((item) => {
                  <td>{name}</td>;
                })}
                <td>Active</td>
                <Grid container spacing={1}>
                  <Grid item xs={6}>
                    <BorderColorIcon style={{ color: "green" }} />
                    {/* <Button variant="contained" color="success" fullWidth>
                      Edit
                    </Button> */}
                  </Grid>
                  <Grid item xs={1}>
                    <DeleteIcon style={{ color: "red" }} />
                    {/* <Button variant="contained" color="error" fullWidth>
                      Delete
                    </Button> */}
                  </Grid>
                </Grid>
              </tr>
            </Table>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};
